import React from "react";
import "../styles/dashboard.css"
import File from "../components/File.js"
import {Link} from "react-router-dom";

function DashboardNavBar(){
    return(
        <div className="navBar" >
            <ul className="dashboard-ul-li">
                <li className="inline-li">
                    <button id="hamburger-button" >
                        &#9776;
                    </button>
                </li>
                <li className="inline-li"><div id="dashboard-navbar-logo-container"><img id="navbar-logo" src="./images/virtual-version-log.png"></img></div></li>
                <li className="inline-li"><Link to="/file"><button className="">New File</button></Link></li>
            </ul>
        </div>
    );
}

export default DashboardNavBar;
